CREATE DATABASE QuanLyPasswordDB;
GO

USE QuanLyPasswordDB;
GO

CREATE TABLE Users (
    UserId INT IDENTITY(1,1) PRIMARY KEY,
    Username NVARCHAR(50) NOT NULL UNIQUE,
    PasswordHash NVARCHAR(256) NOT NULL   -- Mật khẩu được hash (không lưu text thẳng)
);


CREATE TABLE UserAccounts (
    AccountId INT IDENTITY(1,1) PRIMARY KEY,
    UserId INT NOT NULL,                     -- Khóa ngoại liên kết với user
    AccountType NVARCHAR(100) NOT NULL,     -- Loại tài khoản (ví dụ: Facebook, Gmail, etc.)
    LoginUsername NVARCHAR(100) NOT NULL,   -- Tên đăng nhập
    LoginPassword NVARCHAR(256) NOT NULL,   -- Mật khẩu (nên mã hóa để bảo mật)
    Note NVARCHAR(500) NULL,                 -- Ghi chú thêm
    CreatedAt DATETIME DEFAULT GETDATE(),

    FOREIGN KEY (UserId) REFERENCES Users(UserId) ON DELETE CASCADE
);

ALTER TABLE Users
ADD IsMfaEnabled BIT NOT NULL DEFAULT 0,
    MfaSecret NVARCHAR(100) NULL;

